import React, { useState } from "react";
import logo from "./logo.svg";
import "./App.css";
import Menubartemplate from "./template/Menubartemplate.js";
import { Button } from "primereact/button";
import { InputNumber } from "primereact/inputnumber";
import { Card } from "primereact/card";

function App() {
  const [data, setData] = useState(null);
  const [fibonacci, setFibonacci] = useState([]);
  const [number, setNumber] = useState();

  React.useEffect(() => {
    fetch("/api")
      .then((res) => res.json())
      .then((data) => setData(data.message));
    fetch("/fibonacci")
      .then((res) => res.json())
      .then((data) => {
        setFibonacci(data);
      });
  }, []);

  const onNumberChange = (e) => {
    setNumber(_shiftWorkPlan);
  };

  return (
    <div className="App">
      <Menubartemplate />
      <Card title="How to Use" style={{ marginBottom: "2em" }}>
        <div className="p-field">
          <div className="p-text-normal">
            Input your desired number to generate its fibonacci sequence on the
            "Generate Fibonacci Form" and hit the "Submit" button. Your
            fibonacci sequence is generated along with its sorted form
          </div>
        </div>
      </Card>

      <div className="p-grid">
        <div className="p-col">
          <Card title="Generate Fibonacci Form" style={{ marginBottom: "2em" }}>
            <div className="p-field">
              <label htmlFor="number" className="p-sr-only">
                Number
              </label>
              <InputNumber
                inputId="integeronly"
                value={number}
                onValueChange={(e) => setNumber(e.value)}
              />
            </div>
            <Button type="button" label="Submit" />
          </Card>
        </div>

        <div className="p-col">
          <Card title="Input Number" style={{ marginBottom: "2em" }}>
            <div className="p-field">
              <label htmlFor="firstname5" className="p-sr-only">
                Firstname
              </label>
              <InputNumber
                inputId="integeronly"
                value={number}
                onValueChange={(e) => setNumber(e.value)}
              />
            </div>
            <Button type="button" label="Submit" />
          </Card>
        </div>
      </div>
    </div>
  );
}

export default App;
